import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import MentorList from './pages/MentorList';
import StudentList from './pages/StudentList';
import './index.css';


function App() {
  return (
    <div className="mentor-student-app">
      <header className="mentor-student-header">
        <h1>MentorStudent</h1>
      </header>
      <nav className="mentor-student-nav">
        {/* Navigation items */}
      </nav>
      <main className="mentor-student-main">
        {/* Main content */}
      </main>
      <footer className="mentor-student-footer">
        {/* Footer content */}
      </footer>
    </div>
  );
}

export default App;
